import React, { useEffect, useState } from "react";
import { useSearchParams } from "react-router-dom";

const Player = () => {
  const [params, setParams] = useSearchParams();

  const [data, setdata] = useState();
  const fetchData = async ()=> {
    const data = await fetch(
      `https://www.googleapis.com/youtube/v3/playlistItems?part=snippet&maxResults=50&playlistId=${params.get(
        "id"
      )}&key=AIzaSyDJ52biB-uP3dEVPSavt6PZZWY0Ee1Rp3g`
    )
const json = await data.json();
setdata(json);
   
  }

  useEffect(()=>{
    fetchData();
   },[])
  return (
    <div>
      <iframe
        width="560"
        height="315"
        src="https://www.youtube.com/embed/videoseries?si=uA3413ghvKnQvGa9&amp;list=PL0b6OzIxLPbxStBQ21C2toa5uQMqHEoRT"
        title="YouTube video player"
        frameborder="0"
        allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share"
        allowfullscreen
      ></iframe>
    </div>
  );
};

export default Player;
